import React from "react";
importT


const AboutMe = () => {
    return (
      <div className="container">
        <p className="about">About Me 
        <Typewriter
          options={{
            autoStart: true,
            loop: true,
            delay: 70,

            pauseFor: 5000,
            strings: ["Hello I am Roniel Overton a FullStack web developer and this is my portfolio. Check out my about me page for more info an please stop by my projects page to see different projects I've worked on"]
          }}
          />  
        </p>
     </div> 
    )
}

export default AboutMe
